import React, { Component } from "react";
import axios from 'axios'

export default class App extends Component {

constructor(props){
  super(props);
this.state={
  lab:[]
};

}

componentDidMount(){
  this.retriveReports();
}

retriveReports(){
  axios.get("http://localhost:8000/lab").then(res =>{

  if(res.data.success){
    this.setState({
      lab:res.data.existingLab
    });

    console.log(this.state.lab)
  }

  });
}

  render() {
    return(
      <div>

      </div>
    )
  }
}
